import React from 'react';

const netimg = "https://www.fillmurray.com/640/360";
const titleN = "Dark";
const titleS = "Web Series 1";
const linkN = "https://www.fillmurray.com/640/360";
const altN = "Netflix img 1";

function Card(){
    return(
        <>
            <h1 className = "heading">Netflix Series</h1>
            <div className = "card-box">
                <img src = {netimg} alt= {altN} />
                <p> {titleS} </p>
                <h2> {titleN} </h2>
                <p><a href = {linkN} trager = "_blank">Click Me </a></p>
            </div>
        </>
    );
}

export default Card;
